import React from "react";
import comercioIcon from "./img/i-comercio.webp";
import depIcon from "./img/i-dep.webp";
import eduIcon from "./img/i-edu.webp";
import guarIcon from "./img/i-guar.webp";
import infraIcon from "./img/i-infrasocial.webp";
import ppIcon from "./img/i-pp.webp";
import saludIcon from "./img/i-salud.webp";
import mercadoIcon from "./img/i-mercado.webp";

function AGEBInfo({ ageb, neighborhood }) {
  if (!ageb || !neighborhood) {
    return <div>No neighborhood or AGEB information available.</div>;
  }

  return (
    <div className="ageb-container">
      <div className="ageb-info">
        <div className="name">
          <h4>{neighborhood.display_name}</h4>
          <p className="cvegeo">CVEGEO: {ageb.properties.CVEGEO}</p>
        </div>

        <p>
          <img className="icon" src={saludIcon} alt="Salud Icon" /> Centros de
          Salud: {ageb.properties.salud_count}
        </p>

        <p>
          <img className="icon" src={eduIcon} alt="Educación Icon" /> Centros
          Educativos: {ageb.properties.educacion_count}
        </p>

        <p>
          <img className="icon" src={depIcon} alt="Deportivos Icon" /> Centros
          Deportivos: {ageb.properties.deportivos_count}
        </p>

        <p>
          <img
            className="icon"
            src={infraIcon}
            alt="Infraestructura Social Icon"
          />{" "}
          Infraestructura Social: {ageb.properties.infraestructura_count}
        </p>

        <p>
          <img className="icon" src={ppIcon} alt="Plazas Públicas Icon" />{" "}
          Plazas Públicas: {ageb.properties.pp_count}
        </p>

        <p>
          <img className="icon" src={guarIcon} alt="Guarderías Icon" />{" "}
          Guarderías: {ageb.properties.guarderias}
        </p>

        <p>
          <img className="icon" src={mercadoIcon} alt="Comercio Icon" />{" "}
          Mercados: {ageb.properties.comercios_count}
        </p>

        <p>
          <img className="icon" src={comercioIcon} alt="Comercio Icon" />{" "}
          Abarrotes: {ageb.properties.abarrotes}
        </p>
      </div>

      <div className="population-info">
        <h4 className="name">Población</h4>
        <div className="poblacion">
          <p>
            {/* <img className="icon" src={saludIcon} alt="Salud Icon" />  */}
            Población Total: {ageb.properties.POBTOT}
          </p>
          <p>
            {/* <img className="icon" src={saludIcon} alt="Salud Icon" />  */}
            F: {ageb.properties.POBFEM}
          </p>
          <p>
            {/* <img className="icon" src={saludIcon} alt="Salud Icon" />  */}
            M: {ageb.properties.POBMAS}
          </p>
        </div>
        <p>
          {/* <img className="icon" src={saludIcon} alt="Salud Icon" />  */}
          Total de Viviendas: {ageb.properties.VIVTOT}
        </p>
        <p>
          {/* <img className="icon" src={saludIcon} alt="Salud Icon" />  */}
          Hogares con jefe de familia masculino: {ageb.properties.HOGJEF_M}
        </p>
        <p>
          {/* <img className="icon" src={saludIcon} alt="Salud Icon" />  */}
          Hogares con jefe de familia femenino: {ageb.properties.HOGJEF_F}
        </p>
      </div>

      <div className="model-info">
        <h4 className="name">Population info goes here...</h4>
        <p>
          {/* <img className="icon" src={saludIcon} alt="Salud Icon" />  */}
          Hogares con alumbrado público: {ageb.properties.ALUMPUB}
        </p>
        <p>
          {/* <img className="icon" src={saludIcon} alt="Salud Icon" />  */}
          Hogares con árboles: {ageb.properties.ARBOLES}
        </p>
        <p>
          {/* <img className="icon" src={saludIcon} alt="Salud Icon" />  */}
          Hogares con banqueta: {ageb.properties.BANQUETA}
        </p>
        <p>
          {/* <img className="icon" src={saludIcon} alt="Salud Icon" />  */}
          Hogares con drenaje: {ageb.properties.DRENAJEP}
        </p>
        <p>
          {/* <img className="icon" src={saludIcon} alt="Salud Icon" />  */}
          Hogares con recubrimiento: {ageb.properties.RECUCALL}
        </p>
      </div>

      <div className="other-info">
        <h4 className="name">Other info goes here...</h4>
      </div>
    </div>
  );
}

export default AGEBInfo;
